import React from 'react';



const Fetchpokemon = ({pokemons,urls}) => {

    var pokemonid = [];
    urls.forEach((url)=>{
    	fetch(url)
    	.then(resp => resp.json())
    	.then(info=>console.log(info))

    })


    return 1;
}



export default Fetchpokemon;
